import React, { FC } from 'react';
import styled from 'styled-components';
import Logo from '../Logo';

const Holder = styled.div`
  max-width: 1200px;
  margin-right: auto;
  margin-left: auto;
`;

const Content = styled.div`
  margin-top: 40px;
  margin-bottom: 40px;
`;

const Layout: FC = ({children}) => (
  <Holder>
    <Logo />
    <Content>
      {children}
    </Content>
  </Holder>
);

export default Layout;
